// Given the part ID or model name, get info from PartSelect site
export const getInfo = async (userQuery) => {

    let url = "https://www.partselect.com/"

    let response = await fetch(url);
    let text = await response.text();
    let parser = new DOMParser();
    const doc = parser.parseFromString(text, 'text/html');

    return doc

  };
